import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Login from "../Login/Login";

function RouterURL(){
    return(
        <Router>
            <Route path="/" component={Login}/>

        </Router>
    );
}
export default RouterURL;
